import React from 'react';
import "./Blog.css";
import { Container, Row, Col } from "react-bootstrap";

function MbbsFeeStructure() {
    return (
        <div>
					<div className="service__bg">
						<h1 className="service__title">2020 MBBS FEE STRUCTURE IN INDIA AND ABROAD</h1>
					</div>
					<Container>
						<div className="blog__post__img">
						<img src="assets/images/blog-banners/mbbs-fee-structure-in-india-abroad.png" alt=""/>
						</div>
					</Container>
					<section>
						<Container>
							<p className="blog__post__desc">MBBS is one of the most popular career paths as MBBS course is an immensely valued degree or course across the globe. MBBS from Abroad is economical as compare to India and it is totally worth to study MBBS in abroad with top MCI approved medical universities or colleges with affordable fee structure and without any donation for MBBS admission in different countries.</p>
							<p>MBBS in abroad is a great option for every medical student, especially for Indians. There are around 10,000 Indian students who get admission to MBBS abroad every year. The number of Indian students keeps increasing to study MBBS abroad as the quality of education is extremely high.</p>
						</Container>
					</section>
        </div>
    )
}

export default MbbsFeeStructure;
